    const theme = useContext(SiteTheme);
    return <>
        <div className="darkM" style={{fontSize:"13px", borderTop:"2px solid black", color: theme.background, background: theme.color }} id="footer">
            <p id="footerText">&#169; Idan Shoshani</p>
        </div>
    </>
}

export default Footer;
